class Solution2038 {
	
	private enum State{
		oneA, multiA, oneB, multiB
	}//end enum
	
    public boolean winnerOfGame(String s) {
    	//special case, s length is not enough for Alice to remove any piece
    	if (s.length()<3) {
    		return false;
    	}//fi    	
    	int numOfInteriorA = 0;
    	int numOfInteriorB = 0;
    	State prevCharState;
    	char[] sCharArr = s.toCharArray();
    	if (sCharArr[0]=='A') {
    		prevCharState = State.oneA;
    	} else {
    		prevCharState = State.oneB;
    	}//fi
    	sCharArr[0]=' ';
    	for (char c:sCharArr) {
    		if (c=='A') {
    			switch (prevCharState) {
    			case oneA:
    				prevCharState = State.multiA;
    				break;
    			case multiA:
    				numOfInteriorA++;
    				break;
    			default:
    				prevCharState = State.oneA;
    				break;
    			}//end switch
    		} else if (c=='B') {
    			switch (prevCharState) {
    			case oneB:
    				prevCharState = State.multiB;
    				break;
    			case multiB:
    				numOfInteriorB++;
    				break;
    			default:
    				prevCharState = State.oneB;
    				break;
    			}//end switch
    		}//fi
    	}//rof
    	//System.out.println(numOfInteriorA + " : " + numOfInteriorB);
    	return numOfInteriorA-numOfInteriorB>=1;
    }//end method  
    
   
}//end class

class Solution2038_V2 {
		
    public boolean winnerOfGame(String s) {
    	//special case, s length is not enough for Alice to remove any piece
    	if (s.length()<3) {
    		return false;
    	}//fi    	
    	int numOfInteriorA = 0;
    	int numOfInteriorB = 0;
    	for (int i=1; i<s.length()-1; i++) {
    		if (s.charAt(i-1)=='A' && s.charAt(i)=='A') {
    			if (s.charAt(i+1)=='A') {
    				numOfInteriorA++;
    			} else {
    				i++;
    			}//fi
    		} else if (s.charAt(i-1)=='B' && s.charAt(i)=='B') {
    			if (s.charAt(i+1)=='B') {
    				numOfInteriorB++;
    			} else {
    				i++;
    			}//fi
    		}//fi
    	}//rof
    	//System.out.println(numOfInteriorA + " : " + numOfInteriorB);
    	return numOfInteriorA-numOfInteriorB>=1;
    }//end method  
    
   
}//end class


